import React from "react";
import {
  Text,
  Flex,
  Box,
  VStack,
  HStack,
  Icon,
  Badge,
  Spacer,
  TouchableOpacity,
  Animated,
  Divider,
  Pressable,
  Button,
  Center,
} from "native-base";
import RidersCard from "../../../_shared/libs/Riders_MoneyFlow_Card";
import { Entypo, SimpleLineIcons, AntDesign } from "@expo/vector-icons";

const Login = () => {
  return (
    <Box w="100%" flex={1} backgroundColor="#F6F5F5" px="8" pt="60px">
      <Box>
        <Center>SendMe Logo</Center>
        <Box>
          <HStack>
            <Text>Sign</Text>
            <VStack>
              <Text
                borderBottom="solid"
                borderBottomWidth="4"
                borderBottomColor="red"
              >
                Up
              </Text>
            </VStack>
          </HStack>
          <Text>Confirm your details and create password</Text>
        </Box>
      </Box>
    </Box>
  );
};

export default Login;
